import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://webapi.partcommunity.com/service/table/vertical?apikey=e66120f9d9624823884cac1bf290ea88&language=english&eol=1&plm=true&includeunclassifiedbycountry=false&enablePreviewPerLine=true&path=bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj&includecrossref=true');
        const result = await response.json();
        setData(result);
      } catch (error) {
        console.error('Error fetching the data', error);
      }
    };

    fetchData();
  }, []);

  if (!data) {
    return <div>Loading...</div>;
  }

  const cnsordernoValue = data.index.line.values.CNSORDERNO.values[0].value;
  const mnValue = data.index.line.values.MN.values[0].value;
  const typeValue = data.index.line.values.TYP.values[0].value;
  const csValue = data.index.line.values.CS.values[0].value;
  const tsValue = data.index.line.values.TS.values[0].value;
  const drValue1 = data.index.line.values.DR.values[0].name;
  const drValue2 = data.index.line.values.DR.values[1].name;

  return (
    <div>
      <p>Order Number: {cnsordernoValue}</p>
      <p>Material Number: {mnValue}</p>
      <p>Type: {typeValue}</p>
      <p>Component series: {csValue}</p>
      <p>Tank size: {tsValue}</p>
      <p>Drive:</p>
      <p>{drValue1}</p>
    </div>
  );
}

export default App;
